(13, 'HS-30', 'http://superadmin.laptopcitypro.com/storage/app/public/WTeoCOS5rvAhkx8RMCmyNRzhba3Y1Ltni47inoGv.png', 'http://superadmin.laptopcitypro.com/storage/app/public/UgWYTQk9kTf9pgisC3zvvryJGPQbVyTZFywur4Pp.png', 'http://superadmin.laptopcitypro.com/storage/app/public/8puoKaIs6pT7bjU50I65clM8M5DzcXdaSJs1d1aY.png', 'http://superadmin.laptopcitypro.com/storage/app/public/Yq95R3yeb7YIeIuODqgNdNyz9aSZ1qZ71kjqZZ1A.png', 'Play, pause, rec, stop, eject! Amazing quality. Stunning Sound. Superior\r\n Comfort! The soft ear-pad covers comfortably on ear to provide absolute\r\n sound quality as if you\' re in your own world. In-Line Mic is great for\r\n messenger on the PC!', 'Black', 'NA', '<table><tbody><tr><td colspan=\"2\">Style: On-the-Head\r\n</td></tr><tr><td colspan=\"2\">Speaker: 40 mm \r\n</td></tr><tr><td colspan=\"2\">Frequency Range: 20 Hz-20 KHz\r\n</td></tr><tr><td colspan=\"2\">Impedance: 32 Ohm\r\n</td></tr><tr><td colspan=\"2\">RMS: 50 mW\r\n</td></tr><tr><td colspan=\"2\">Sensitivity: 102 dB\r\n</td></tr><tr><td colspan=\"2\">MIC Sensitivity: -50 dB\r\n</td></tr><tr><td colspan=\"2\">Cable Length: 2 m\r\n</td></tr><tr><td colspan=\"2\">Plug: 3.5 mm\r\n</td></tr><tr><td colspan=\"2\">Controller: Volume knob on the headset\r\n</td></tr><tr><td colspan=\"2\">System Requirements: WindowsXP / Vista / 7 / 8 / 8.1 / 10</td></tr></tbody></table>');
