INSERT INTO `siteinfo` (`id`, `about`, `terms`, `ploicy`, `purchase_guide`, `about_company`, `address`, `android_app_link`, `ios_app_link`, `facebook_link`, `twitter_link`, `instagram_link`, `delivery_notice`, `payment_instruction`) VALUES
(1, '<h2>About US <br>\r\n</h2>\r\n<p>It has been exactly 3 years since I wrote my first blog series \r\nentitled “Flavorful Tuscany”, but starting it was definitely not easy. \r\nBack then, I didn’t know much about blogging, let alone think that one \r\nday it could become <strong>my full-time job</strong>. Even though I had\r\n many recipes and food-related stories to tell, it never crossed my mind\r\n that I could be sharing them with the whole world.</p>\r\n<p>I am now a <strong>full-time blogger</strong> and the curator of the <a data-cke-saved-href=\"https://ckeditor.com/ckeditor-4/#\" href=\"https://ckeditor.com/ckeditor-4/#\">Simply delicious newsletter</a>, sharing stories about traveling and cooking, as well as tips on how to run a successful blog.</p>\r\n<p>If you are tempted by the idea of creating your own blog, please think about the following:</p>\r\n<ul><li>Your story (what do you want to tell your audience)</li><li>Your audience (who do you write for)</li><li>Your blog name and design<br>\r\n	</li></ul>\r\n<p>After you get your head around these 3 essentials, all you have to do is grab your keyboard and the rest will follow.</p>', '<h2>Refund Terms<br>\r\n</h2>\r\n<p>It has been exactly 3 years since I wrote my first blog series \r\nentitled “Flavorful Tuscany”, but starting it was definitely not easy. \r\nBack then, I didn’t know much about blogging, let alone think that one \r\nday it could become <strong>my full-time job</strong>. Even though I had\r\n many recipes and food-related stories to tell, it never crossed my mind\r\n that I could be sharing them with the whole world.</p>\r\n<p>I am now a <strong>full-time blogger</strong> and the curator of the <a data-cke-saved-href=\"https://ckeditor.com/ckeditor-4/#\" href=\"https://ckeditor.com/ckeditor-4/#\">Simply delicious newsletter</a>, sharing stories about traveling and cooking, as well as tips on how to run a successful blog.</p>\r\n<p>If you are tempted by the idea of creating your own blog, please think about the following:</p>\r\n<ul><li>Your story (what do you want to tell your audience)</li><li>Your audience (who do you write for)</li><li>Your blog name and design<br>\r\n	</li></ul>\r\n<p>After you get your head around these 3 essentials, all you have to do is grab your keyboard and the rest will follow.</p>', '<h2>Privacy <br>\r\n</h2>\r\n<p>It has been exactly 3 years since I wrote my first blog series \r\nentitled “Flavorful Tuscany”, but starting it was definitely not easy. \r\nBack then, I didn’t know much about blogging, let alone think that one \r\nday it could become <strong>my full-time job</strong>. Even though I had\r\n many recipes and food-related stories to tell, it never crossed my mind\r\n that I could be sharing them with the whole world.</p>\r\n<p>I am now a <strong>full-time blogger</strong> and the curator of the <a data-cke-saved-href=\"https://ckeditor.com/ckeditor-4/#\" href=\"https://ckeditor.com/ckeditor-4/#\">Simply delicious newsletter</a>, sharing stories about traveling and cooking, as well as tips on how to run a successful blog.</p>\r\n<p>If you are tempted by the idea of creating your own blog, please think about the following:</p>\r\n<ul><li>Your story (what do you want to tell your audience)</li><li>Your audience (who do you write for)</li><li>Your blog name and design<br>\r\n	</li></ul>\r\n<p>After you get your head around these 3 essentials, all you have to do is grab your keyboard and the rest will follow.</p>', '<h2>How To Purchase<br>\r\n</h2>\r\n<p>It has been exactly 3 years since I wrote my first blog series \r\nentitled “Flavorful Tuscany”, but starting it was definitely not easy. \r\nBack then, I didn’t know much about blogging, let alone think that one \r\nday it could become <strong>my full-time job</strong>. Even though I had\r\n many recipes and food-related stories to tell, it never crossed my mind\r\n that I could be sharing them with the whole world.</p>\r\n<p>I am now a <strong>full-time blogger<